import { NavLink } from "react-router-dom";

export default function TestCaseItem({event}){
    return (
        <div className="tbody">
            <div className="tr">
                <NavLink to={`/dashboard/folder/${event.id}`} className={({isActive})=>isActive? classes.active : ""}>{event.id}</NavLink>
                <NavLink to={`/dashboard/folder/${event.id}`} className={({isActive})=>isActive? classes.active : ""}>{event.title}</NavLink>
            </div>
        </div>
    )
}
